import React from "react";
import Navbar from "../components/navbar";

function MarketRates() {
  return (
    <div className="container">
      <Navbar/>
      <h2>Market Rates</h2>
      <p>
        Here you can view the current market rates for different crops and
        commodities.
      </p>
      {/* Display market rates dynamically here */}
    </div>
  );
}

export default MarketRates;
